import { StyleSheet } from "react-native";

export default StyleSheet.create({
    input: {
        padding: 5,
        display: "flex",
        justifyContent: "space-around",
        flexDirection: "row",
    },
    page: {
        alignItems: 'center',
    },
    btn: {
        margin: 10,
        borderColor: 'black',
        borderWidth: 2,
    }
})
